import React, { useState, useEffect } from 'react';
import { useApp } from '../context/AppContext';
import { format } from 'date-fns';
import { Flame, Zap, Star, ChevronRight, Moon, BookOpen, Dumbbell } from 'lucide-react';
import axios from 'axios';
import ProgressRing from '../components/ProgressRing';

function Dashboard() {
  const { xp, streak, getLevel, prayers, habits, location } = useApp();
  const [dailyAyah, setDailyAyah] = useState(null);
  const [nextPrayer, setNextPrayer] = useState(null);
  const [countdown, setCountdown] = useState('');

  const level = getLevel();

  // Calculate progress
  const prayersDone = Object.values(prayers).filter(p => p === 'on_time' || p === 'late').length;
  const prayerProgress = (prayersDone / 5) * 100;
  const habitsDone = habits.filter(h => h.completed).length;
  const habitsProgress = (habitsDone / habits.length) * 100;

  useEffect(() => {
    // Fetch daily ayah
    axios.get('http://localhost:5000/api/daily-ayah')
      .then(res => setDailyAyah(res.data))
      .catch(console.error);
  }, []);

  useEffect(() => {
    if (!location) return;

    // Fetch prayer times
    axios.get(`http://localhost:5000/api/prayer-times?latitude=${location.latitude}&longitude=${location.longitude}`)
      .then(res => {
        const data = res.data;
        const now = new Date();
        const prayerOrder = ['fajr', 'sunrise', 'dhuhr', 'asr', 'maghrib', 'isha'];

        for (const name of prayerOrder) {
          if (name === 'sunrise') continue;
          const time = new Date(data[name]);
          if (time > now) {
            setNextPrayer({ name, time });
            break;
          }
        }
      })
      .catch(console.error);
  }, [location]);

  useEffect(() => {
    if (!nextPrayer) return;

    const interval = setInterval(() => {
      const now = new Date();
      const diff = nextPrayer.time - now;

      if (diff <= 0) {
        setCountdown('Now');
        return;
      }

      const hours = Math.floor(diff / (1000 * 60 * 60));
      const minutes = Math.floor((diff % (1000 * 60 * 60)) / (1000 * 60));
      const seconds = Math.floor((diff % (1000 * 60)) / 1000);

      setCountdown(`${hours}h ${minutes}m ${seconds}s`);
    }, 1000);

    return () => clearInterval(interval);
  }, [nextPrayer]);

  return (
    <div className="dashboard">
      {/* Header */}
      <header className="dashboard-header">
        <div className="greeting">
          <span className="date">{format(new Date(), 'EEEE, MMMM d')}</span>
          <h1>Ø§Ù„Ø³Ù„Ø§Ù… Ø¹Ù„ÙŠÙƒÙ…</h1>
          <p>Peace be upon you</p>
        </div>
        <div className="level-badge">
          <Star size={16} />
          <span>{level.name}</span>
        </div>
      </header>

      {/* Stats Row */}
      <div className="stats-row">
        <div className="stat-card">
          <Flame className="stat-icon fire" size={24} />
          <div className="stat-value">{streak}</div>
          <div className="stat-label">Day Streak</div>
        </div>
        <div className="stat-card">
          <Zap className="stat-icon gold" size={24} />
          <div className="stat-value">{xp}</div>
          <div className="stat-label">Total XP</div>
        </div>
      </div>

      {/* Next Prayer Card */}
      {nextPrayer && (
        <div className="next-prayer-card card-gradient">
          <div className="prayer-info">
            <Moon size={24} />
            <div>
              <span className="prayer-label">Next Prayer</span>
              <h2 className="prayer-name">{nextPrayer.name.charAt(0).toUpperCase() + nextPrayer.name.slice(1)}</h2>
            </div>
          </div>
          <div className="countdown">
            <span className="countdown-value">{countdown}</span>
            <span className="countdown-label">
              {format(nextPrayer.time, 'h:mm a')}
            </span>
          </div>
        </div>
      )}

      {/* Progress Rings */}
      <div className="progress-section">
        <h3>Today's Progress</h3>
        <div className="rings-row">
          <div className="ring-item">
            <ProgressRing progress={prayerProgress} color="var(--ring-salah)" size={80} strokeWidth={8} />
            <span className="ring-label">Salah</span>
            <span className="ring-value">{prayersDone}/5</span>
          </div>
          <div className="ring-item">
            <ProgressRing progress={habitsProgress} color="var(--ring-habit)" size={80} strokeWidth={8} />
            <span className="ring-label">Habits</span>
            <span className="ring-value">{habitsDone}/{habits.length}</span>
          </div>
        </div>
      </div>

      {/* Daily Ayah */}
      {dailyAyah && (
        <div className="daily-ayah card">
          <h3>ðŸ“œ Daily Ayah</h3>
          <p className="arabic ayah-text">{dailyAyah.arabic}</p>
          <p className="translation">{dailyAyah.translation}</p>
          <span className="reference">â€” Surah {dailyAyah.surahName}, Ayah {dailyAyah.ayah}</span>
        </div>
      )}

      <style>{`
        .dashboard {
          padding: 20px;
          padding-bottom: 100px;
        }
        .dashboard-header {
          display: flex;
          justify-content: space-between;
          align-items: flex-start;
          margin-bottom: 24px;
        }
        .greeting .date {
          font-size: 12px;
          color: var(--text-muted);
          text-transform: uppercase;
          letter-spacing: 1px;
        }
        .greeting h1 {
          font-family: 'Amiri', serif;
          font-size: 32px;
          color: var(--gold);
          margin: 8px 0 4px;
        }
        .greeting p {
          color: var(--text-secondary);
          font-size: 14px;
        }
        .level-badge {
          display: flex;
          align-items: center;
          gap: 6px;
          background: var(--bg-surface);
          padding: 8px 14px;
          border-radius: 20px;
          font-size: 12px;
          font-weight: 600;
          color: var(--gold);
        }
        .stats-row {
          display: grid;
          grid-template-columns: 1fr 1fr;
          gap: 12px;
          margin-bottom: 20px;
        }
        .stat-card {
          background: var(--bg-surface);
          border-radius: 16px;
          padding: 16px;
          text-align: center;
        }
        .stat-icon {
          margin-bottom: 8px;
        }
        .stat-icon.fire { color: #FF6B35; }
        .stat-icon.gold { color: var(--gold); }
        .stat-value {
          font-size: 28px;
          font-weight: 700;
          font-family: 'Space Grotesk', sans-serif;
        }
        .stat-label {
          font-size: 12px;
          color: var(--text-muted);
          margin-top: 4px;
        }
        .next-prayer-card {
          display: flex;
          justify-content: space-between;
          align-items: center;
          padding: 20px;
          border-radius: 16px;
          margin-bottom: 20px;
        }
        .prayer-info {
          display: flex;
          align-items: center;
          gap: 12px;
        }
        .prayer-label {
          font-size: 12px;
          color: var(--text-secondary);
